import { Button, Form, Input, Select } from "antd";

const { Option } = Select;


interface IFProps {
    onFinish: any;
    isLoading?: boolean
}


const CreatePermissionTypeForm: React.FC<IFProps> = ({ onFinish, isLoading }) => {

    return (
        <Form
            size="middle"
            layout="vertical"
            onFinish={onFinish}>
            <Form.Item
                label="Title"
                name="title"
                rules={[{ required: true, message: "Please input role title!" }]}>
                <Input placeholder="Type here" />
            </Form.Item>
            <Form.Item
                label="Is Active"
                name="isActive"
                rules={[{ required: true, message: "Please Select a Value" }]}>
                <Select
                    placeholder="select a value">
                    <Option value="True">True</Option>
                    <Option value="False">False</Option>
                </Select>
            </Form.Item>


            <Form.Item>
                <Button loading={isLoading} type="primary" htmlType="submit">
                    Submit
                </Button>
            </Form.Item>
        </Form>
    );
};

export default CreatePermissionTypeForm;
